import React from 'react';
import { BrowserRouter,Route,Redirect,Switch } from 'react-router-dom';
import Users from './user/pages/Users';
import NewPlaces from './places/pages/NewPlaces';
function App() {
  return (
    <BrowserRouter>
      <Route path="/" exact>
        <Users />
      </Route>
      <Route path="/places/new" exact>
        <NewPlaces />
      </Route>
      <Redirect to="/"/>
    </BrowserRouter>
  );
}

export default App;
